import { useEffect,useState } from "react"
import {  useNavigate } from "react-router-dom"
import "./das.css"

function App(){
 
    const[fet,setFet]=useState([])
    const [value,setValue]=useState("")
    // const navigate=useNavigate()
    useEffect(()=>{
        fetch("http://localhost:3006/learn")
        .then((jos)=>{
           return jos.json()
        })
        .then((das)=>{
            setFet(das)
        }) 

    },[])

 




   return(
    <div className="container" >
        <div>
            
                <div className="card-body">
                    <div className="two">
                        
                        <ul style={{listStyle:"none"}}>
                        <img src="https://1000logos.net/wp-content/uploads/2017/05/Color-Rolex-Logo.jpg" style={{width:"100px",height:"70px"}} />
                        <li>
                            <input type="text" style={{borderRadius:"20px",width:"500px",height:"40px",marginLeft:"100px",marginTop:"20px"}} value= "  Search for Product"  />
                        </li>
                        <li style={{fontSize:"25px",borderRadius:"50%",marginLeft:"75px",border:"2px solid green",width:"40px",height:"40px",marginTop:"20px",textAlign:"center"}}>  <i class="fa-solid fa-bell"></i></li>
                            
                        </ul>
                    </div>
                  
                   <div className="one">
                              {fet.map((one)=>(
                                <ul style={{listStyle:"none"}} >
                                    <div id="b">
                                    <img src={one.img} style={{width:"200px",height:"200px",marginLeft:"8px"}}></img>
                                    <li><span style={{fontSize:"18px",marginLeft:"35px"}}>Brand :  </span>{one.brand} </li>
                                    <li style={{marginLeft:"35px"}}>{one.collection}</li>
                                    <li><span style={{fontSize:"18px",marginLeft:"35px"}}>Model :  </span>{one.model}</li>
                                    <li style={{marginLeft:"35px"}}>{one.reference}</li>
                                    <li style={{marginLeft:"35px"}}>{one.complement}</li>
                                    <li><span style={{fontSize:"18px",marginLeft:"35px"}}>Year : </span>{one.year}</li>
                                    <li><span style={{fontSize:"18px",marginLeft:"35px"}}>Price : </span>{one.price}</li>
                                    <button id="a" className="btn btn-success">Add Cart</button>
                                    </div>
                                    </ul>

                            
                                      
                              ))}
                    </div>    
                </div>
           
        </div>
    </div>
   )
}

export default App;
